import React from 'react'

function Expertise() {
  return (
    <div className="Expert w-full h-full flex justify-center">
      <div className="excontainer w-[80vw] h-[90vh] bg-slate-500">
        <h1 className="text-6xl font-[HolidayFree] m-">Expertise</h1>
        <div className="cnt flex justify-center">
          <div className="progress w-[70vw] h-[80vh] bg-slate-600"></div>
        </div>
      </div>
    </div>
  );
}

export default Expertise
